import React, { Component } from "react";

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <div className="toprow">
          <div className="streamgraph">
            <h1>I dey mad</h1>
          </div>
          <div className="piechart">
            <h1>I dey mad</h1>
          </div>
        </div>
        <div className="secondrow">
          <div className="stats">
            <h1 className="bigdata">53</h1>
            <p>Total No of Tracks</p>
          </div>
          <div className="stats">
            <h1 className="bigdata">78</h1>
            <p>Total No of Streams</p>
          </div>
          <div className="stats">
            <h1 className="bigdata">25</h1>
            <p>Total No of Downloads</p>
          </div>
          <div className="stats">
            <h1 className="bigdata">$80</h1>
            <p>Total Amount of Sales</p>
            <img src="./images/saleschart.png" />
          </div>
        </div>
      </div>
    );
  }
}

export default Dashboard;
